import classes from "./Dialogs.module.css";

import DialogItem from "./DialogItem/DialogItem";
import Message from "./Message/Message";


const Dialogs = (props) => {


    let dialogElements = props.dialogsPage.dialogsData.map((dialog) => {
        return <DialogItem name={dialog.name} id={dialog.id}/>;
    });

    let messageElements = props.dialogsPage.messagesData.map((msg) => {
        return <Message message={msg.message}/>;
    });

    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>{dialogElements}</div>
            <div className={classes.messages}>
                {messageElements}
                <div className={classes.myMessage}>
                    <input role='textbox' name="" id=""/>
                </div>
            </div>

        </div>
    );
};

export default Dialogs;
